import React, { useState } from 'react';
import './Navbar.css';
import Cart from '../Assets/cart.png';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const [menu, setMenu] = useState("shop");

  return (
    <div className='navbar'>
      <div className="nav-logo">
        <p>Bliss</p>
      </div>
      <ul className="nav-menu">
        <li onClick={() => { setMenu("shop") }}>
          <Link to='/'>Shop</Link>{menu === "shop" ? <hover /> : <></>}
        </li>
        <li onClick={() => { setMenu("mens") }}>
          <Link to='/mens'>Men</Link>{menu === "mens" ? <hover /> : <></>}
        </li>
        <li onClick={() => { setMenu("womens") }}>
          <Link to='/womens'>Women</Link>{menu === "womens" ? <hover /> : <></>}
        </li>
        <li onClick={() => { setMenu("kids") }}>
          <Link to='/kids'>Kids</Link>{menu === "kids" ? <hover /> : <></>}
        </li>
      </ul>
      <div className="login">
        <button>Login</button>
        <img className='imgcart' src={Cart} alt="" />
        <div className='navbar-count'>0</div>
      </div>
    </div>
  );
}

export default Navbar;
